// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Practical1
{
    modifier isRegistered(address user) {
        bool found = false;
        for(uint i = 0; i < counter; i++){
            if(addresses[i] == user){
                found = true;
                break;
            }
        }
        require(found, "This user is not registered");
        _;
    }

    modifier hasTokens(uint tokens) {
        require(addressTokens[msg.sender] >= tokens, "Owner has no this amount of tokens.");
        _;
    }

    mapping(address => uint) private addressTokens;
    address[] private addresses;
    uint private counter = 0;

    function addNewUser() public {
        addressTokens[msg.sender] = 0;
        addresses.push(msg.sender);
        counter++;
    }

    function transferTokens(address to, uint amountOfTokens) public isRegistered(to) isRegistered(msg.sender) hasTokens(amountOfTokens) {
        addressTokens[msg.sender] -= amountOfTokens;
        addressTokens[to] += amountOfTokens;
    }

    function gatherTokens(uint tokens) public isRegistered(msg.sender) {
        addressTokens[msg.sender] = tokens + addressTokens[msg.sender];
    }

    function getBalance(address client) public view isRegistered(client) returns(uint) {
        return addressTokens[client];
    }
}

